import React from 'react';
import styled from 'styled-components';


const FooterBar = styled.footer`
    background-color: #35414d;
    display: flex;
    flex-flow: row;
    justify-content: center;
    align-items: center;
`

const Footer = () => {
    return(
        <FooterBar>
            <h6>Terms of Service</h6>
            <h6>Private Policy</h6>
            <h6>Report Abuse</h6>
        </FooterBar>
    ) 

}

export default Footer;
